$=G.cloneNode();$.textContent="About Us";const ee=J.cloneNode();ee.textContent="Chef Kuya Angelo's Childhood";const te=Q.cloneNode();te.textContent="Born to Filipino parents-- one of whom immigrated to States as a child, the other of whom immigrated as an adult,     Kuya Angelo's upbringing was one characterized by weirdness and contradictions. His parents often alternated between feeling shame and nostalgia for their homeland.     While this did change for the better in their final years, Angelo reflects that both the shame and nostalgia left long-lasting impressions upon him.     The shame compelled him to distance himself from his heritage, leaving him largely ignorant of his parents' culture. There was still the nostalgia, though perhaps shallow,     that got him and his family through harder times. Angelo only visited the Philippines with his family once, and though he was young and the memories are faint, they are among his     most cherished. In particular, the memories of food and of music still reach him to this day.";const oe=J.cloneNode();oe.textContent="Not That Cinderella";const ne=Q.cloneNode();ne.textContent="So why Cinderella's? Well, as mentioned previously, it wasn't just food Kuya Angelo cared about, it was also the music. Manila Sound--     a genre of music characterized by its globalized, western influence-- is particularly close to his heart. So many of these songs randomly inject English into their lyrics     because it sounds cooler than Tagalog. It's a sentiment with which I'm well-acquainted. But I listen to this music nowadays, and the part that sticks out to me the most     is the distinctly Filipino essence of Manila Sound. This music was coming out during a really rough and pivotal moment for the country, and the radical positivity and love     that radiates that period of music meant something. So, why Cinderella's? Cinderella was a pop band in the 70's, and a lot of their music from back then has such a strong voice     even to this day. Also, I'd considered calling the place Hotdog, but I was worried it might give people the wrong idea.";const ae=J.cloneNode();ae.textContent="Mission Statement";const ie=Q.cloneNode();ie.textContent="If you're on this site, you probably checked the menu first. You may have noticed that the menu is fairly limited and you may be wondering why that     that is. Well, simply put, expanding a menu is expensive. The more items on a menu, the smaller a percentage of the menu actually gets ordered. And while I'd love to expand the menu someday,     it is important to me to keep the menu cheap and to keep my employees well-paid. When you start a restaurant-- or any business, really-- you have three things to consider: your ambitions,     customers, your workers. One of these will always get the short end of the stick, and most places choose to harm their employees. I choose to let my pride and ambitions take a back seat so     that no one else has to suffer for it.";const le=R.cloneNode(),de=V.cloneNode();de.src="../img/house.jpg",de.alt="The old Mendoza Family house",le.appendChild(de),le.id="infoAside";const se=X.cloneNode(),ce=G.cloneNode();ce.textContent="Contact Us";const re=Q.cloneNode();re.textContent="Address: 610 1st Ave, San Diego, CA 92101";const he=Q.cloneNode();he.textContent="Number: (619) 515-1460",se.appendChild(ce),se.appendChild(re),se.appendChild(he),Z.appendChild($),Z.appendChild(ee),Z.appendChild(te),Z.appendChild(oe),Z.appendChild(ne),Z.appendChild(ae),Z.appendChild(ie);const me=document.getElementById("content"),pe=()=>{let e=me.childNodes.length;for(let t=0;t<e;t++)me.removeChild(me.lastElementChild)},ue=()=>{pe(),[p,v,x,S].forEach(e=>me.appendChild(e))};(()=>{let e=document.querySelectorAll(".homePageLink");for(let t=0;t<e.length;t++)e[t].addEventListener("click",()=>ue())})(),(()=>{let e=document.querySelectorAll(".infoPageLink");for(let t=0;t<e.length;t++)e[t].addEventListener("click",()=>(pe(),void[Z,le,se].forEach(e=>me.appendChild(e))))})();